import React from "react";

import { Wrapper, Content, Text } from "./NavBar.styles";

const Navbar = () => (
  <Wrapper>
    <Content>
      <h1>Mixed Tape</h1>
      <Text>
        <ul>
          <li>Home</li>
          <li>Login</li>
        </ul>
      </Text>
    </Content>
  </Wrapper>
);

export default Navbar;
